import React from "react";
import { Link } from "react-router-dom";
import "./dogCard.css";

const DogCard = ({ dog }) => {
  return (
    <div className="dog-card">
      <Link to={`/dogs/${dog.id}`}>
        <img src={dog.image} alt={dog.name} />
        <h2>{dog.name}</h2>
      </Link>
    </div>
  );
};

export default DogCard;
